    useEffect(() => {
        axios.get('https://dog.ceo/api/breeds/list/all')
        .then(res => {
            console.log(res.data.message)
            let breedsArr = []
            for(var i in res.data.message){
                if(Boolean(res.data.message[i][0])){
                    breedsArr.push({
                        i: [res.data.message[i]]
                    })
                }
            }
            console.log(breedsArr)
        })
        .catch(err => {
            console.log(err)
        })
    }, [])

    useEffect(() => {
        console.log(breeds)
    }, [breeds])

    return (
        <div>
        </div>
    );
}

